import React from 'react';

const Category3DGraphic = () => {
    // Hier können Sie die Integration der 3D-Grafik implementieren
    return (
        <div>
            {/* Hier wird die 3D-Grafik angezeigt */}
            <canvas id="categoryCanvas"></canvas>
        </div>
    );
}

export default Category3DGraphic;
